import ListFiles from './ListFiles';
import { Router, Route, Switch } from 'react-router';

import React, { Component } from 'react';

class App extends Component {
  render() {
    return (
      <div>
        <Router>
          <Switch>
            <Route path='/:directory?' component={ListFiles} />
          </Switch>
        </Router>
      </div>
    );
  }
}

App.propTypes = {};

export default App;
